import React from 'react'

type Props = {
  setPasser :React.Dispatch<React.SetStateAction<string>>
}

const Passer:React.FC<Props> = ({setPasser}) => {

  const handleChange = (e: React.ChangeEvent<HTMLSelectElement>) =>{
    setPasser(e.target.value);
  }  
  return (
    <>
        <div className="mx-2 mt-2"><h5>Passer</h5></div>
            <select name="example" onChange={(e)=>handleChange(e)} className="col-10 col-sm-3">
                <option value="0">-</option>
                <option value="11">11</option>
                <option value="13">13</option>
            </select>
    </>
  )
}

export default Passer
